'use client';

import { Fragment, useEffect, useState } from 'react';

const images = [
  'data:image/jpeg;base64,',
  'data:image/jpeg;base64,',
  'data:image/jpeg;base64,',
  'data:image/jpeg;base64,',
  'data:image/jpeg;base64,',
  'data:image/jpeg;base64,',
];

export default function Page() {
  const [is666, set666] = useState<boolean>(false);
  const [tick, setTick] = useState<number>();
  const [_66666, set_66666] = useState<boolean>();

  useEffect(() => {
    if (is666) {
      document.body.style.backgroundColor = 'red';
      setTimeout(
        () => {
          set_66666(true);
        },
        Math.round(Math.random() * 1000) % 66666,
      );
    }
  }, [is666]);

  useEffect(() => {
    if (_66666 !== undefined) {
      Promise.all(
        Array(66)
          .fill(
            Array(66).fill(async () => {
              await fetch(window.origin);
              set_66666((state) => !state);
            }),
          )
          .flat()
          .map((fn) => fn()),
      );
      console.log('_66666');
    }
  }, [_66666]);

  useEffect(() => {
    if (tick) {
      setTimeout(
        () => {
          setTick(new Date().getTime());
          setTimeout(
            () => {
              document.body.style.background = `url(${images[Math.round(Math.random() * 1000) % images.length]}) no-repeat center / cover`;
              setTimeout(() => {
                document.body.style.background = 'red';
              }, 6);
            },
            Math.round(Math.random() * 1000) % 66666,
          );
        },
        Math.round(Math.random() * 1000) % 6666,
      );
    }
  }, [tick]);

  return (
    <div
      style={{
        position: 'relative',
        height: '100%',
      }}
    >
      {is666 ? (
        <>
          {Array(66)
            .fill(1)
            .map((_, i) => (
              <Fragment key={i}>
                <span
                  style={{
                    position: 'absolute',
                    top: `${Math.round(Math.random() * 1000) % 100}%`,
                    left: `${Math.round(Math.random() * 1000) % 100}%`,
                    fontSize: 12 + (Math.round(Math.random() * 1000) % 66),
                    fontWeight: 700,
                    transform: `rotate(${Math.round(Math.random() * 1000) % 360}deg)`,
                    transition: 'all 66ms',
                  }}
                >
                  {Array(1 + (Math.round(Math.random() * 1000) % 65))
                    .fill('6')
                    .join('')}
                </span>
              </Fragment>
            ))}
        </>
      ) : (
        <button
          onClick={() => {
            set666(true);
            setTick(new Date().getTime());
          }}
          style={{
            backgroundColor: is666 ? 'red' : undefined,
          }}
        >
          666
        </button>
      )}
    </div>
  );
}
